import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Desktop.module.css";

const Desktop = () => {
  const navigate = useNavigate();

  const onHomeTextClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onProjectsTextClick = useCallback(() => {
    navigate("/projects-page");
  }, [navigate]);

  return (
    <div className={styles.desktop2}>
      <img className={styles.desktop2Child} alt="" src="/rectangle-33@2x.png" />
      <header className={styles.header}>
        <div className={styles.logo}>
          <img className={styles.logoChild} alt="" src="/rectangle-34@2x.png" />
        </div>
        <div className={styles.frame}>
          <div className={styles.navbar}>
            <div className={styles.home} onClick={onHomeTextClick}>
              Home
            </div>
            <div className={styles.aboutMe}>About Me</div>
            <div className={styles.projects} onClick={onProjectsTextClick}>
              Projects
            </div>
            <div className={styles.contact}>{`Contact `}</div>
          </div>
        </div>
      </header>
    </div>
  );
};

export default Desktop;
